import React from 'react';

const Home=()=> {
    return (
      <>
        <div className="home">
          <div className="card home-card">
            <h5>Sitanshu</h5>
            <div className="card-image">
              <img src="https://images.unsplash.com/photo-1514952854033-e453317dc9c0?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=750&q=80" alt="ee"/>
            </div>
            <div className="card-content">
              <h6>Title</h6>
            </div>
          </div>
        </div>
      </>
    );
  }
  
  export default Home;
